import React from "react";
import Tabs, { TabPane } from "@iso/components/uielements/tabs";
// import * as TableViews from "@iso/containers/Tables/TableViews/TableViews";
import * as TableViews from "@iso/containers/Tables/TableViews/TableViews";
import { tableinfos } from "@iso/containers/Tables/AntTables/configs";
import fakeData from "@iso/containers/Tables/data";

const BaoHieu = () => {
  const Component = TableViews.SortView;
  const dataList = new fakeData(5);

  function renderTable(tableInfo) {
    return <Component tableInfo={tableInfo} dataList={dataList} />;
  }

  return (
    <div className="container">
      <Component tableInfo="sortView" dataList={dataList} />
    </div>
  );
};

export default BaoHieu;
